(51, 3, 'Jordan Profile', 'Agent and Broker', 'Active', 'Jordan', 'Cachero', 'CCW Company', 'Sample Slogan', '09261000883', 'jrdncchr@gmail.com', 'http://www.genuinecore.com/jordan/blog/contact', 'Very Good Person.|Very Happy Person.|Very Cool Person.|Very Awesome Person.|Very Talented Person.|Very Crazy Person.|7|8|9|10|', 'I am a web developer...', '2013', 'http://www.sample.com/free', 'http://www.sample.com/all', 'http://www.ccw.com/', 'Jasper Pangulayan', 'Somewhere in Baguio', '0988293123', '008', 'http://www.listing-book.com/jrdncchr', 'http://www.facebook.com/jrdncchr', 'http://www.twitter.com/jrdncchr', 'http://www.linkedin.com/jrdncchr', 'http://www.youtube.com/jrdncchr', '{"image1":"http:\\/\\/leadgeneratortools.net\\/resources\\/others\\/uploads\\/php\\/files\\/3ccf15f0f940aff42936dfd4d43398af.jpg","image2":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","image3":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","text":"Owner"}', '{"image1":"http:\\/\\/leadgeneratortools.net\\/resources\\/others\\/uploads\\/php\\/files\\/62d01336d62dfbad1595cfe7473ad2f7.png","image2":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","image3":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","text":"Logo"}', '2014-02-24 16:55:45'),
(52, 3, 'Hunter X Hunter', 'Agent and Broker', 'Active', 'Gon', 'Freecs', 'Hunters Guild', 'Hunter Slogan', '0926100885', 'hxh@gmail.com', 'http://www.hunterxhunter.com', 'Gon is awseomely amazing.|Son of Jin|||||||||', 'Hunter Gon son of Hunter Jin', '2013', 'http://www.freesearch.com', 'http://www.alllistings.com', 'http://www.company.com', 'Killua', 'Zoldick', '09261000994', '002', '', '', '', '', '', '', '', '2014-03-11 01:16:00'),
(53, 5, 'Mike Cribbin', 'Agent and Broker', 'Active', 'Mike', 'Cribbin', 'Cribbin Realty', 'Where Performance Outsells Promises', '(314) 954-6500', 'mike@cribbinrealty.com', 'http://cribbinrealty.com/contact/', 'Mike Cribbin has earned my trust and highest recommendation as a realtor. Until I hired Mike to sell my property, my home sat on the market for months and months without a bid. Mike employed a variety of marketing techniques and within weeks he got a proposal that eventually turned into a sale. -  Thanks Mike ~ Sue and Mark|The reason I agreed to write this is because you amazed me. I had my home listed for over 1 year with 2 different realtors. I was hesitant to use you because you were not with a BIG company. Well as the story goes you listed my home and in 4 days we had an accepted contract. You are the BEST I have ever seen. ~ Terri McMillian|I know you had to be very patient with us because we didn''t know what we were looking for in a new home. After answering all of you questions we were able to narrow it down and find the perfect home for us. thanks for spending so much time listening and showing us homes. ~ Ralph and Virgina Wells|Just want to thank you for all your help, guidance and support in this most stressful time of buying my home. You took command and orchestrated the situation with such ease. Your professionalism and knowledge of real estate as well as incorporating "new technology" was very much respected and appreciated. I could not have done this without you!!!!!!!!! ~ Brad|||||||', 'With over 30+ years of experience I have seen many different real estate climates.  For expert advise whether you are buying or selling a property in the current real estate environment contact me today! ', '1977', 'http://search.cribbinrealty.com/idx/17504/advancedSearch.php', 'http://cribbinrealty.com/', 'http://cribbinrealty.com/', 'Cribbin Realty', '3112 Brook Hollow, O''fallon MO 63366', '(636) 294-6061', 'MO Real Estate Broker # 1999012699', '', '', '', '', '', '', '', '2014-03-23 02:26:57'),
(54, 8, 'Mike Cribbin', 'Agent and Broker', 'Active', 'Mike', 'Cribbin', 'Cribbin Realty', 'Where Performance Outsells Promises', '(314) 954-6500', 'mike@cribbinrealty.com', 'http://cribbinrealty.com/contact', 'I know you had to be very patient with us because we didn''t know what we were looking for in a new home. After answering all of you questions we were able to narrow it down and find the perfect home for us. thanks for spending so much time listening and showing us homes.  ~ Ralph and Virgina Wells|The reason I agreed to write this is because you amazed me. I had my home listed for over 1 year with 2 different realtors. I was hesitant to use you because you were not with a BIG company. Well as the story goes you listed my home and in 4 days we had an accepted contract. You are the BEST I have ever seen.  ~ Terri McMillian|Great job marketing & Selling our house Mike! Contract in 17 days, closed 30 days later... WOW... You are the man!  ~ Kirk and Jennifer|Mike Cribbin made being a first time home buyer a great experience. I would recommend Mike to anyone who is even thinking of buying or selling a house! ~  Jessica and Drew Elwell|You have made my life bearable again getting me out from under this house. I didn''t really expect to sell in 4 days, but thanks. I will recommend you to anyone just have them call me. Now lets get me a new home.  ~  Steve Kline|Thanks for helping us negotiate a great deal on our new home. Without some your advice and keeping us patient I know we would have over paid. You are one calm person, never letting anything get you rattled. I thought your flinching technique was funny at first, but it worked. ~  Jim and Karlee Michaels|After being on the market with another real estate company for 6 months, you listed my home and sold it in 3 days.  This was not someone who had already seen the home it was someone you found to come and look at my house.  I don''t know what you did or how you did it, but I will refer you to EVERYONE I know. ~ Crystal Andersen|This is fun to write because you sold my house in 3 days and had multiple offers.  I got $5,600 more than list price.  Your are great.  I will be referring you to all my friends and family.  Mike, you Rock!!!  ~ Sara Huntley|Thanks for showing me the home I requested and then walking me through the entire buying process.  I don''t know what I would have done without.  You are a very patient man.  My mom and dad will be selling their home soon, they are also going to use you. ~ Ashley Deilman|I want everyone to know that Mike did an awesome job selling my home.  He sold it in 1 day.  When he called me I thought he had more questions to ask about the home.  I wouldn''t have dreamed that he had a firm cash offer for my house in just 1 day.  THANKS! ~  James and Ruth Cummings|', 'With over 30+ years of experience, I can help you whether you are buying your dream home or selling your next property.  The real estate environment is constantly changing and I been through most of the different cycles in the market.', '1977', 'http://search.cribbinrealty.com/idx/17504/advancedSearch.php', 'http://cribbinrealty.com', 'http://cribbinrealty.com/', 'Cribbin Realty', '3112 Brook Hollow, O''fallon MO 63366', '(636) 294-6061', 'MO Real Estate Broker # 1999012699', '', 'http://www.facebook.com/pages/Cribbin-Realty/117201826589', 'https://twitter.com/CribbinRealty', '', 'https://www.youtube.com/user/CribbinRealty', '{"image1":"http:\\/\\/leadgeneratortools.net\\/resources\\/others\\/uploads\\/php\\/files\\/25a0022e76dffe57fa1684658252223e.JPG","image2":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","image3":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","text":"Mike Cribbin"}', '{"image1":"http:\\/\\/leadgeneratortools.net\\/resources\\/others\\/uploads\\/php\\/files\\/c20b405d77dffd5169096ec6306efd25.png","image2":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","image3":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","text":"Cribbin Realty"}', '2014-04-02 13:35:37'),
(55, 9, 'Jasper Pangulayan', 'Agent and Broker', 'Active', 'Jasper', 'Pangulayan', 'CCW', 'Sample', '5566', 'jasper@gmail.com', 'http://www.sample.com', 't1|t2|t3|t4|t5|t6|t7|t8|t9|t10|', 'Sample About', '2013', 'http://www.free.com', 'http://www.all.com', 'http://sample.com', 'broker name', 'broker@gmail.com', 'broker phone', '512', '', '', '', '', '', '', '', '2014-04-08 11:43:35'),
(56, 28, 'rogerhayer', 'Agent and Broker', 'Active', 'Roger & Rosie', 'Hayer', 'Keller Williams', 'Your satisfaction is our success!', '512-796-9395', 'rogerhayer@gmail.com', 'http://www.512austinhomes.com', 'I have been most impressed with Roger''s patience and professionalism in helping to bring the sale of my home to a quick and successful conclusion. Clearly, not all real estate agents are created equal. I''m glad we had selected Roger and his company. - Maan Family Austin, TX|Great job! What a relief. Thank you very much for being so patient and willing to work with us during the sale of the house. Erika and I really appreciate all your hard work. You got us the record high sale price for our house. - Gonzales Family Round Rock, TX|Rosie and Roger, just wanted to drop you a note to say thank you for selling our house so quickly. We are very happy in our new place. Please come and visit sometime. - Kevin Andrew Austin, TX|We loved Rosie''s enthusiasm and professionalism. My house was on the market for over 6 months and never sold. When I decided to work with Rosie, she stayed on top of the market and showings poured in when she listed. She sold our house and negotiated a great price for us. She is very honest and looked for our interest at all times. - Mesuria Family Austin, TX|||||||', 'As an agent who''s an expert in this local area, I bring a wealth of knowledge and expertise about buying and selling real estate here. It''s not the same everywhere, so you need someone you can trust for up-to-date information.\n\nI am licensed to do business in the state of Texas by the Texas Real Estate Commission - License (Roger #586306) (Rosie #622318). Texas law requires all real estate licensees to give the following information about brokerage services: http://www.trec.state.tx.us/pdf/contracts/OP-K.pdf', '2008', 'http://www.512austinhomes.com', 'http://www.512austinhomes.com', 'http://www.512austinhomes.com', 'Keller Williams', '12515-8 Research Blvd. Suite 100 Austin, TX 78759', '(512) 796-9395', 'Broker Lic#:492214, Rosie Hayer Lic#:622318, Roger', '', 'https://www.facebook.com/512austinhomes', 'https://twitter.com/TheHayerGroup', 'https://www.linkedin.com/pub/roger-hayer/a1/6aa/20b', 'https://www.youtube.com/channel/UCkQ0pRVN34T0k_7McIfhvng', '{"image1":"http:\\/\\/leadgeneratortools.net\\/resources\\/others\\/uploads\\/php\\/files\\/4364d58fa48d58cb3118179548f5c578.jpg","image2":"http:\\/\\/leadgeneratortools.net\\/resources\\/others\\/uploads\\/php\\/files\\/2288751d94dc5ac7a4740db2f549e37d.jpg","image3":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","text":""}', '{"image1":"http:\\/\\/leadgeneratortools.net\\/resources\\/others\\/uploads\\/php\\/files\\/fb4067385d265eba2af56d292220e66f.jpg","image2":"http:\\/\\/leadgeneratortools.net\\/resources\\/others\\/uploads\\/php\\/files\\/382f7bece6a0ef25d2da5f3e8bad1c49.jpg","image3":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","text":""}', '2014-08-13 17:42:15'),
