(58, 30, 'Dan Raymer', 'Agent and Broker', 'Active', 'Dan', 'Raymer', 'Guarantee Real Estate', 'Results That Move You', '559 355 7756', 'dtraymer@gmail.com', 'http://www.GreatHomesInFresno.com', 'K. Wright- I highly recommend Dan Raymer, as an agent in and around the Fresno, CA area. I found him to be very knowledgeable regarding the sale of homes in the area. He was always prompt with any information that I needed, and kept me up to date on matters concerning the sale. My house sold quickly and I give the credit to Dan, as an excellent agent. I found him to be honest and a man of integrity. I have already recommended him to friends.|M. Hensley- I recommended Dan''s services to a close family friend. He was very professional, but most importantly was very caring towards my friend''s needs. He communicated frequently and walked her through the sale of her home with confidence. I would recommend him to future friends & clients knowing that they will be in good hands.|Kathy and Dave- We loved working with Dan! We bought a great house in just the neighborhood we wanted. He was patient, informed, and professional throughout our entire experience. We would definitely recommend him to friends and family who need a reliable and knowledgeable real estate agent.|Steve and Carol- We have had the privilege of being both buyers and sellers through Dan. He is the most responsive agent we have ever worked with. His knowledge is top notch. When we sold through him, his advise was spot on. When we bought through him, he knew our wants and desires and he worked to make sure we got them. Our needs are a bit more complicated than the average client -- we are out of town clients. Dan made every effort to make our transactions as easy as possible. I can not say enough good about our experiences with Dan. I whole-heartedly recommend him for your real estate needs.|The Crockers- Our experience with Dan Raymer was very positive. We listed our home with Dan and he guided us through every detail along the way. Dan was knowledgeable when we had questions. He did a beautiful job displaying our home on the website and getting it sold in record time. What I liked about Dan is his honesty and integrity. Dan is now our Realtor and I recommend him to you.|Ian Vandrick- Dan was great. He made our house shopping experience enjoyable. Dan always was super prompt in replying to any questions we had, responding to emails, or any other correspondence we had with him. When we found our house, he helped us through the paper work and made that process as easy as possible. We really enjoyed working with Dan. When it came time for my mom to sell her house, we heartily recommended Dan to her. He did a great job helping my mom sell her house. My mom was very pleased with him.|G. Donan- Dan Raymer is a great realtor, very prompt and professional. He quickly answered emails, texts and phone calls. He exceeded my expectations. I have rarely experienced such quick response time with other professionals. I thank him for all his assistance and professional advise to find the right investment properties. He is very knowledgeable, honest and patient. I highly recommend Dan for all your real estate needs and definitely plan to use him again in the future.|Anthony Bonilla- Dan Raymer was an excellent realtor through the stressful process of buying a home. He was very patient in making sure that the homes he sought after would be homes that we would consider and had the things we wanted. He even offered his own opinions on certain homes and was not hesitant to advise us against something he didn''t see would benefit us. The best part of his efforts is that there wasn''t a question he wouldn''t answer. He would provide us with the best information we needed. Even now, six months after moving in he is more than happy to answer any questions that arise! Professional, patient, and passionate. If you''re in search of a new home, don''t look any further!|Tess F.- We bought our 1st house w/ Dan''s help. He is very hardworking, patient and always available to answer our questions. We would definitely recommend him to our friends and family!|David and Rocio Ribb- “My wife and I had been searching for a house off and on for a few years. We had tried a few other Realtors, but they always showed us what they thought they could get us into not what we wanted. Dan was the first Realtor to actually listen to our wants and needs. He always asked us to rate the houses after we saw them (1 -10). Toward the end of our search, not only was he emailing and showing us houses we’d like, but he could guess both our ratings pretty accurately which confirmed to us he heard what we wanted in a house. When we finally chose our house, (a short sale), Dan worked very hard to help us. Even with the bumps in the road he kept helping and went the extra mile to make sure we got the house we wanted. We are very thankful and blessed to have met Dan. Without his help we would not be in the house we love.|', 'Dan Raymer offers unparalleled service to ALL clients in the Fresno Area, California real estate market. Your complete satisfaction with our service and representation is our number one priority.\n\nDan serves the entire Fresno, California real estate market including the surrounding communities such as Clovis, Hanford, Kerman, Kingsburg, Madera, Reedley, Parlier, Sanger, Selma, and Visalia areas.\n\nWhether you are considering buying a home, selling a home or both, we know this area inside and out.\n', '2004', 'http://www.findfresnoareahomes.com/', '', 'http://www.GreatHomesInFresno.com', 'Dan Raymer', '3 RiverPark Place East', '559-355-7756', '01461039', '', 'http://www.facebook.com/dtraymer', 'https://twitter.com/dtraymer', '', 'https://www.youtube.com/user/danraymer', '', '', '2014-08-21 16:43:07'),
