(68, 105, 'Hanleyhomesqca', 'Agent and Broker', 'Active', 'Sean ', 'Hanley', 'Hanley Homes QCA', '', '563-484-9776', 'hanleyhomesqca@gmail.com', 'http://hanleyhomesqca.kwrealty.com/contact/', 'We are writing to recommend Sean as your realtor. He is knowledgeable, personable and follows what you want/looking for all the way down the pipeline. We could always reach him with any questions that we had. We liked him so much as our buying agent that we chose him to be our selling agent as well. Victoria & Scott|Working with Sean was a real pleasure.  I appreciated his professionalism and willingness to help in any way possible to find the right home for me and my family.  I look forward to working with him in the future and would strongly encourage anyone looking to buy or sell a home to work with Sean. - Miguel Morga|||||||||', 'As an agent who''s an expert in this local area, I bring a wealth of knowledge and expertise about buying and selling real estate here. It''s not the same everywhere, so you need someone you can trust for up-to-date information. I am eager to serve you. ', '2013', 'http://hanleyhomesqca.kwrealty.com/search/', 'http://hanleyhomesqca.kwrealty.com/featuredlistings/', 'http://www.hanleyhomesqca.com/', 'Keller Williams Realty Greater Quad Cities ', '1225 E. River Dr. STE 110 Davenport, IA 52803', '563-345-6520', 'Licensed in IA & IL ', '', 'https://www.facebook.com/hanleyhomesqca', 'https://twitter.com/HanleyHomesQCA', 'https://www.linkedin.com/hp/?dnr=GcXkYJlA_t9hGEhwdHjkr__A_Axhk--K7Vj', 'https://www.youtube.com/channel/UC2r2CCwo-ZBCFDFDngcPppQ', '{"image1":"http:\\/\\/leadgeneratortools.net\\/resources\\/others\\/uploads\\/php\\/files\\/34311dd922f05f95a0b86b413af8aba8.jpg","image2":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","image3":"http:\\/\\/leadgeneratortools.net\\/resources\\/images\\/img-placeholder.png","text":""}', '', '2015-04-28 21:55:00'),
