(9, 54, '1340 Sleepy Hollow Dr.', 'Troy', 'Troy', 'Troy', 'MO', 'Missouri', '63379', 'United States', 'Lincoln County', 'Residential Home', 'The curtain is rising-be the first to see.  If it is possible to be better than new, then this one is!! 3 bedroom 2 bath ranch with main floor laundry.\n\nHome has a divided bedroom plan, neutral decor and vaulted ceilings. The 6 paneled doors are painted with stained trim. The sunroom and extra large garage are two of the added bonuses included with this sale.\n\nHigh efficiency LP gas furnace and water heather. The hall bathroom has a jetted tub and the master suite is handicapped equipped. The great room has an LP gas fireplace. Trim, cabinets and flooring are all upgraded. Ready to go. C.O.D. – Come On Down a Fast possession is possible.', '14017596', 'Main floor laundry|Divided bedroom floor plan|Vaulted ceilings, neutral decor, and 6 paneled doors|Relax with your plants in the sunroom|Extra large garage for all your toys|High efficiency LP gas furnace and water heater|Master suite is handicapped equipped|Hall bathroom has a jetted tub|Great room features a LP gas fireplace|Upgraded trim, cabinets and flooring|', '3', '2 Full', '1,600', 2004, '10,062 sq ft', 'http://cribbinrealty.com/listings/1340-sleepy-hollow-dr/', 'Lincoln County R-III', 'Troy Buchanan High', 'Troy Middle', 'Lincoln Elementary', 'From HWY 61 Take Missouri U / Crossroads BLVD exit\nTurn LEFT onto E State HWY U (5 miles)\nTurn RIGHT onto State HWY J (2.7miles)\nTurn RIGHT onto Excalibur Blvd (180 ft)\nTake the 1st LEFT onto Sleepy Hollow (.2 miles)\nHouse on the left\n', 'http://cribbinrealty.com/listings/1340-sleepy-hollow-dr/', '', 'For Sale', 'Homes', 'Real Estate', 'Ranch|3 Bedroom|Newly Listed|', 'Homes For Sale in 63379|Ranch Homes For Sale in Lincoln County|3 Bedroom Homes For Sale in Troy|Newly Listed Homes For Sale in Troy|Ranch 3 Bedroom Homes For Sale in Troy|Ranch Newly Listed Homes For Sale in Troy|3 Bedroom Newly Listed Homes For Sale in Troy|Real Estate For Sale in Troy|Ranch Real Estate For Sale in Troy|3 Bedroom Real Estate For Sale in Troy|Newly Listed Real Estate For Sale in Troy|Ranch 3 Bedroom Real Estate For Sale in Troy|Ranch Newly Listed Real Estate For Sale in Troy|3 Bedroom Newly Listed Real Estate For Sale in Troy|1340 Sleepy Hollow Dr.|1340 Sleepy Hollow Dr. Troy|1340 Sleepy Hollow Dr. Troy MO|1340 Sleepy Hollow Dr. Troy MO 63379|', 'false', '2014-04-07 15:33:29'),
