(54, 54, '531 Kings Manor', 'O''fallon', 'O Fallon', 'Ofallon', 'MO', 'Missouri', '63368', 'United States', 'St Charles county', 'Residential Home', 'Many were interested before it had to come off the market for family reasons, now it is back and better than before.\n\nWARNING!! IF YOU SEE THIS HOME YOU WILL WANT TO BUY IT!!\n\nThis split bedroom ranch is fantastic, you are going to find a wood foyer, vaulted dining room, great room and kitchen. Kitchen features updated lighting, 42 in. cabinets, breakfast bar, double door pantry and more wood floors.\n\nThere is also a breakfast room which leads out to a large deck with steps. The Master bedroom suite is nice and large with a huge walk-in closet. The master bath is to die for, double sinks, jet tub and a separate shower.\n\nThis home has been professionally landscaped and has many, many extras. The other 2 bedrooms are also large and have walk-closets. The main bathroom has been updated recently.\n\nThe neighborhood also features a subdivision pool.', '14062288', 'Split bedroom ranch|Vaulted ceilings in the dining, kitchen and great rooms|Kitchen features updated lighting, 42 in. cabinets, breakfast bar, double door pantry and more wood floors|Breakfast room which leads out to a large deck with steps|Master bedroom suite is nice and large with a huge walk-in closet|Master bath is to die for with double sinks, jetted tub, and a separate shower.|Professionally landscaped and has many, many extras|2 other bedrooms are also large and have walk-closets|Neighborhood also features a subdivision pool|Main bathroom has been updated recently.|', '3', '2 full', '2,253', 2000, '8,276 Sq Ft', 'http://cribbinrealty.com/listings/531-kings-manor-dr-o-fallon-ranch-home-for-sale/', 'Francis Howell R-III', 'Francis Howell High', 'Francis Howell Middle', 'John Weldon Elementary', 'From HWY 64/40 go  \nRIGHT or north onto HWY K\nLEFT onto Crusher Dr\nRIGHT onto Weldon Springs Rd\nRIGHT onto Fieldstone Farms\nRIGHT onto Bentley Park\nLE